import { CUR_FOLDER_NOTES, SELECTED_NOTE, CUR_EDITOR_VALUE } from '../actions/types';

const initialState = {
    notes: [],
    selectedNote: {},
    curEditorValue: []
};

export default (state = initialState, action) => {
    switch (action.type) {
        case CUR_FOLDER_NOTES:
            return {
                ...state,
                notes: action.payload,
            };
        case SELECTED_NOTE:
            return {
                ...state,
                selectedNote: action.payload,
            };
        case CUR_EDITOR_VALUE:
            return {
                ...state,
                curEditorValue: action.payload
            }
        default:
            return state;
    }
};
